import { Container, Row, Col } from "react-bootstrap";

const FooterComponent = () => {
  return;
  <Container fluid>
    <Row>
      <Col>Copyright &copy; My Shop</Col>
    </Row>
  </Container>;
};

export default FooterComponent;
